?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">Эта немецкая компания по производству часов была основана в 1961 году. Как и всем компаниям, расположенным в Германии, Sinn присущи такие качества, как тщательность производства и проработка всех без исключения деталей. Отличительная черта часов Sinn отсутствие всяческих украшений, исключительно строгий дизайн. На протяжении всего своего функционирования, компания никогда не меняла облик своих часов. Главная мысль компании модернизация механизмов часов. В своем ассортименте компания представляет различные модели, начиная от повседневных, и заканчивая сложнейшими моделями с несметным количеством функций. Каждая модель по-своему индивидуальна и неповторима. И дело далеко не в дизайне. У каждого экземпляра часов разная техническая начинка. Кроме того, компания Sinn выпускает и лимитированные серии часов, которые отличаются использованием в них инновационных технологий и функций. Некоторые модели обладают и водонепроницаемостью до 200 метров. Часы Sinn производятся специально для людей, которые предпочитают строгость и классику, без каких-либо излишеств.</span></span></p>
 
